import React from 'react';
import { Carousel } from 'antd';
import AppLayout from '../components/Applayout';


const Main = () => {
  return (
    <AppLayout>
      <Carousel autoplay style={{ height: '160px', backgounrdColor: '#364d79', lineHeight: '160px', overflow: 'hidden' }}>
        <div>
          <h3>1</h3>
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
      </Carousel>
    </AppLayout>
  );
};

export default Main;
